import React from 'react';
import { NavLink, Outlet } from 'react-router-dom';
import NavBar from './components/nav/NavBar';
import './layout.css';

const Layout = () => (
  <div>
    <header className="header-row" style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: '0 20px' }}>
      <img src="/anuka.png" alt="Anuka Photos Banner" className="banner-img" />
      <div className="account-link">
        <NavLink to="/my-account" style={{ fontSize: '18px', color: '#3e2723', textDecoration: 'none', fontWeight: '400' }}>
          My Account
        </NavLink>
      </div>
    </header>

    <NavBar />

    <main>
      <Outlet />
    </main>
  </div>
);

export default Layout;
